"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Eustachian tube problems (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/eustachian-tube-problems-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H196543197\">",
"      <span class=\"h1\">",
"       What is the eustachian tube?",
"      </span>",
"      &nbsp;&mdash;&nbsp;The eustachian tube is a tube that connects the middle ear (the part of the ear behind the eardrum) to the back of the nose and throat (",
"      <a class=\"graphic graphic_figure graphicRef50422 \" href=\"UTD.htm?1/49/1809\">",
"       figure 1",
"      </a>",
"      ).",
"     </p>",
"     <p>",
"      Normally, the eustachian tube helps keep the air pressure inside the middle ear the same as the air pressure outside the middle ear. If there is a problem with the eustachian tube, the air pressure inside the middle ear won&rsquo;t be the same as the air pressure outside it. This can damage the middle ear and cause ear pain, hearing loss, and other symptoms. &ldquo;Ear barotrauma&rdquo; is the term doctors use for when people have symptoms or damage in the middle ear because of air pressure differences.",
"     </p>",
"     <p>",
"      Most eustachian tube problems are not serious. They usually last only a short time and get better on their own.",
"     </p>",
"     <p>",
"      But eustachian tube problems sometimes lead to serious problems, such as:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        A middle ear infection",
"       </li>",
"       <li>",
"        A torn eardrum",
"       </li>",
"       <li>",
"        Hearing loss",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Long-term hearing loss from eustachian tube problems can also lead to language or speech problems in children.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H196543204\">",
"      <span class=\"h1\">",
"       What causes eustachian tube problems?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Common causes of eustachian tube problems are:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Illnesses or conditions that make the eustachian tubes swollen or inflamed &ndash; These include colds, allergies, ear infections, or sinus infections. The sinuses are hollow areas in the bones of the face.",
"       </li>",
"       <li>",
"        Sudden air pressure changes &ndash; Sudden air pressure changes can happen when people fly in an airplane, scuba dive, or drive in the mountains.",
"       </li>",
"       <li>",
"        Growths that block the eustachian tube",
"       </li>",
"       <li>",
"        Being born with an abnormal eustachian tube",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H196543211\">",
"      <span class=\"h1\">",
"       What are the symptoms of a eustachian tube problem?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Common symptoms of a eustachian tube problem include:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Ear pain",
"       </li>",
"       <li>",
"        Feeling pressure or fullness in the ear",
"       </li>",
"       <li>",
"        Trouble hearing",
"       </li>",
"       <li>",
"        Ringing in the ear",
"       </li>",
"       <li>",
"        Feeling dizzy",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H196543218\">",
"      <span class=\"h1\">",
"       Should I see a doctor or nurse?",
"      </span>",
"      &nbsp;&mdash;&nbsp;See your doctor or nurse if your symptoms are severe, get worse, or if they don&rsquo;t go away after a few days.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H196543225\">",
"      <span class=\"h1\">",
"       Will I need tests?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Probably not. Your doctor or nurse should be able to tell if you have a eustachian tube problem by learning about your symptoms and doing an exam.",
"     </p>",
"     <p>",
"      If your symptoms are severe or last for a long time, your doctor or nurse might:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Have you see a special kind of doctor called an ear, nose, and throat doctor",
"       </li>",
"       <li>",
"        Do tests to check your hearing",
"       </li>",
"       <li>",
"        Do an imaging test &ndash; Imaging tests can create pictures of the inside of the body.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H196543232\">",
"      <span class=\"h1\">",
"       How are eustachian tube problems treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Treatment depends on what&rsquo;s causing the eustachian tube problem. Depending on your individual situation, your doctor might treat you with 1 or more of the following:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Nose sprays",
"       </li>",
"       <li>",
"        Antihistamines &ndash; These medicines are usually used to treat allergies. They help stop itching, sneezing, and runny nose symptoms.",
"       </li>",
"       <li>",
"        Decongestants &ndash; These medicines can help with stuffy nose symptoms.",
"       </li>",
"       <li>",
"        Antibiotic medicines &ndash; If you have an infection caused by bacteria, your doctor can treat it with antibiotics.",
"       </li>",
"       <li>",
"        Surgery &ndash; Most people do not need surgery for eustachian tube problems. But people might need surgery if their symptoms don&rsquo;t get better with medicines or they have severe or long-term symptoms.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H196543281\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
"     <p>",
"      <a class=\"medical medical_basics\" href=\"UTD.htm?43/38/44642?source=see_link\">",
"       Patient information: Ear infections (otitis media) (The Basics)",
"      </a>",
"      <br/>",
"      <a class=\"medical medical_basics\" href=\"UTD.htm?17/55/18291?source=see_link\">",
"       Patient information: Cough, runny nose, and the common cold (The Basics)",
"      </a>",
"      <br/>",
"      <a class=\"medical medical_basics\" href=\"UTD.htm?36/38/37474?source=see_link\">",
"       Patient information: Seasonal allergies in adults (The Basics)",
"      </a>",
"      <br/>",
