"       Patient information: Vertigo (a type of dizziness) (The Basics)",
"      </a>",
"     </p>",
"     <p>",
"      <a class=\"medical medical_patient\" href=\"UTD.htm?15/16/15619?source=see_link\">",
"       Patient information: Ear infections (otitis media) in children (Beyond the Basics)",
"      </a>",
"      <br/>",
"      <a class=\"medical medical_patient\" href=\"UTD.htm?43/11/44210?source=see_link\">",
"       Patient information: The common cold in adults (Beyond the Basics)",
"      </a>",
"      <br/>",
"      <a class=\"medical medical_patient\" href=\"UTD.htm?39/44/40643?source=see_link\">",
"       Patient information: The common cold in children (Beyond the Basics)",
"      </a>",
"     </p>",
"    </div>",
