" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Low power light micrograph of a skin biopsy from a patient with nephrogenic systemic fibrosis",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 442px; height: 346px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    A low magnification image of a skin biopsy from a patient with nephrogenic systemic fibrosis shows subcutaneous septa that are widely expanded by collagen deposits (arrow). The asterisk highlights an area of normal septal thickness, and S indicates the skin surface.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     With permission from: Shawn E Cowper, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    High power light micrograph of a skin biopsy from a patient with nephrogenic systemic fibrosis",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 432px; height: 324px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    A high magnification image of the same skin biopsy shows collagen bundles (pink and red) and numerous elongated cells (blue nuclei).",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     With permission from: Shawn E Cowper, MD.",
"    </div>",
"   </div>",
