"   </div>",
"   <div class=\"cntnt\" style=\"width: 368px; height: 520px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Panel A: Medium power light photomicrograph of a nevoid melanoma, demonstrating striking hypercellularity and hyperchromasia in the dermal component. Panel B: High power light photomicrograph view of the same lesion. The neoplastic cells are hyperchromatic and pleomorphic. Note a readily observed mitosis in the center of the field (red arrow).",
"    <div class=\"footnotes\">",
"    </div>",
